import React from 'react';
import './ShowHousing.css'
import '../../image//464.jpg';
import useFetch from '../../useFetch';
import { NumericFormat } from 'react-number-format';
import { useNavigate } from 'react-router-dom';

const ShowHousing = () => {
const House_API = "http://26.90.237.200:3000/admin/house_type/read";
const { data } = useFetch(House_API);
const navigate = useNavigate();

        return (
          
<div class="container">
  <div class="">

    <div>{data.map(val => 
      <div class="card" key={val.ht_id}> 

      <p>โมเดล {val.name}  </p> 

      <p>ขนาดพื้นที่ {val.usable_area} ตารางเมตร </p> 
      <NumericFormat
        value={val.start_price}
        allowLeadingZeros
        thousandSeparator=","
        displayType="text"
        renderText={(value) => <p>{value} บาท</p>}/>

        <button className='button' onClick={() => {navigate('/Planner');}}> ดูรายละเอียด </button>
    
        <button className='button' onClick={() => {navigate('/HousingEdit');}}> แก้ไข </button>  

      </div>)}
    </div>
    
 
  </div>
</div>
              
   
        )        


  }

  export default ShowHousing;
